const paragraph = `I am a software developer with 4 years of experience, specializing in
front-end development. I currently work with JavaScript, Vue.js
(including unit testing), PHP, Laravel (using Docker), and SQL
databases. I have a degree in Analysis and Systems Development and a
postgraduate degree in Product Management. Additionally, I am familiar
with agile methodologies, including Scrum, and have experience in
product launch and development strategies.`;

const texts = {
  paragraph,
};

export default texts;
